pragma solidity ^0.5.0;
import "openzeppelin-solidity/contracts/math/SafeMath.sol";
import "./newToken.sol";
import "./Ataa.sol";

contract tokenFactory is Ataa(20000) {
    address[] public newTokens;

    function factoryApproval(uint256 AtaaCoinAmount) public {
       approve(address(this), AtaaCoinAmount);
    }

    function increaseFactoryAllowance(uint256 addedAtaaCoin) public {
       increaseAllowance(address(this), addedAtaaCoin);
    }

    function decreaseFactoryAllowance(uint256 subAtaaCoin) public {
       decreaseAllowance(address(this), subAtaaCoin);
    }

    function allowedAtaa() public view returns(uint256) {
     return allowance(msg.sender, address(this));
    }

