   //   require(givenAtaaCoin >= neededAtaaCoin, "More Funds are needed.");

   //   _burn(msg.sender, neededAtaaCoin);

   //    address T = address(new newToken(INITIAL_SUPPLY, name, symbol, decimals, cap, price));
   //    newTokens.push(T);
   //  }

   function createNewToken(uint INITIAL_SUPPLY, string memory name, string memory symbol, uint8 decimals, uint256 toPayAtaa, uint256 price)
    public payable{
     uint256 givenAtaaCoin = allowance(msg.sender, address(this));
     uint256 cap = toPayAtaa * price;
     require(givenAtaaCoin >= toPayAtaa, "More Funds are needed.");

     _burn(msg.sender, toPayAtaa);
     decreaseAllowance(address(this), toPayAtaa);

      address T = address(new newToken(INITIAL_SUPPLY, name, symbol, decimals, cap, price));
      newTokens.push(T);
    }

   function getDeployedTokenContracts() public view returns (address[] memory) {
      return newTokens;
   }

}
